import { useState } from "react";
import "./login.css";

function GoogleIcon() {
  return (
    <svg width="18" height="18" viewBox="0 0 48 48" aria-hidden="true">
      <path fill="#FFC107" d="M43.6 20.5h-1.9V20H24v8h11.3C33.7 32.7 29.3 36 24 36c-6.6 0-12-5.4-12-12S17.4 12 24 12c3 0 5.7 1.1 7.8 3l5.7-5.7C33.9 5.6 29.2 4 24 4 12.9 4 4 12.9 4 24s8.9 20 20 20c10 0 19-7.3 19-20 0-1.2-.1-2.4-.4-3.5z"/>
      <path fill="#FF3D00" d="M6.3 14.7l6.6 4.8C14.6 16.4 18.9 12 24 12c3 0 5.7 1.1 7.8 3l5.7-5.7C33.9 5.6 29.2 4 24 4 15.5 4 8.3 8.5 6.3 14.7z"/>
      <path fill="#4CAF50" d="M24 44c5.2 0 9.9-1.7 13.5-4.7l-6.2-5.1C29.3 36 26.8 37 24 37c-5.3 0-9.7-3.4-11.3-8.1l-6.5 5C8.3 39.5 15.5 44 24 44z"/>
      <path fill="#1976D2" d="M43.6 20.5H24v8h11.3c-1.3 3.8-5.2 6.5-11.3 6.5-6.6 0-12-5.4-12-12S17.4 12 24 12c3 0 5.7 1.1 7.8 3l5.7-5.7C33.9 5.6 29.2 4 24 4 12.9 4 4 12.9 4 24s8.9 20 20 20c10 0 19-7.3 19-20 0-1.2-.1-2.4-.4-3.5z"/>
    </svg>
  );
}

export default function Login() {
  const [form, setForm] = useState({ identifier: "", password: "" });
  const [err, setErr] = useState({});
  const [loading, setLoading] = useState(false);

  const onChange = (e) => {
    const { name, value } = e.target;
    setForm((f) => ({ ...f, [name]: value }));
  };

  const validate = () => {
    const e = {};
    if (!form.identifier.trim()) e.identifier = "Please enter email or phone";
    if (form.password.length < 6) e.password = "At least 6 characters";
    setErr(e);
    return Object.keys(e).length === 0;
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    if (!validate()) return;
    setLoading(true);
    try {
      // TODO: replace with your backend URL
      const res = await fetch("/api/auth/login", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        credentials: "include",
        body: JSON.stringify(form),
      });
      if (!res.ok) throw new Error("Login failed");
      window.location.href = "/";
    } catch (err) {
      setErr({ api: err.message });
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-card">
      <div className="brand-icon">
        {/* cart-with-coin icon substitute */}
        <span role="img" aria-label="cart">ðŸ›’</span>
      </div>

      <h2 className="title">Welcome Back ðŸ‘‹</h2>
      <p className="subtitle">Sign in to find the cheapest shopping near you.</p>

      {err.api && <div className="error" role="alert">{err.api}</div>}

      <form onSubmit={onSubmit} noValidate>
        <div className="field">
          <label className="label" htmlFor="id">Email or Phone</label>
          <input
            id="id"
            name="identifier"
            className="input"
            placeholder="Enter your email or phone"
            value={form.identifier}
            onChange={onChange}
            aria-invalid={!!err.identifier}
          />
          {err.identifier && <div className="error">{err.identifier}</div>}
        </div>

        <div className="field">
          <label className="label" htmlFor="pw">Password</label>
          <input
            id="pw"
            name="password"
            type="password"
            className="input"
            placeholder="Enter your password"
            value={form.password}
            onChange={onChange}
            aria-invalid={!!err.password}
          />
          {err.password && <div className="error">{err.password}</div>}
        </div>

        <button className="primary" disabled={loading}>
          {loading ? "Logging in..." : "Login"}
        </button>
      </form>

      <div style={{height: 10}} />

      <button className="google" type="button" onClick={() => window.location.href='/api/auth/google'}>
        <GoogleIcon />
        <span>Continue with Google</span>
      </button>

      <div className="split">
        <a href="/register">Sign up!</a>
        <a href="/reset">Forgot Password?</a>
      </div>

      <p className="footer-note">Cheapest Shopping List Near Me</p>
    </div>
  );
}
